import React from 'react';

const AppContainer = ({ children }) => (
  <div style={{ 
    backgroundImage: `https://images.unsplash.com/photo-1597290282695-edc43d0e7129?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1175&q=80`, 
    backgroundRepeat: 'no-repeat', 
    backgroundSize: 'cover',
    opacity: .7, 
  }}>
    {children}
  </div>
);

export default AppContainer;
